function App() {


  return (



    <div className="App">

      <Test
        img="./img/air.png"
        name="cat1"
        phone="0615"
        email="cat@gmmail.com"


      />
      <Test
      img="./img/hero.jpeg"
      name="cat2"
      phone="061500"
      email="cat2@gmmail.com"

      />

      <Test
         img="./img/swim.png"
         name="cat3"
         phone="061500555"
         email="cat3@gmmail.com"


      />

    </div>
  );
}

export default App;
